<script>
import { ref, toRaw } from 'vue';

export default {
    props: {
        geografija: {
            type: Object,
            required: true,
        },
        maxBrojPotpisa: {
            type: Number,
            required: true,
        },
        maxProcenat: {
            type: Number,
            required: true,
        },
        procentualnaToplota: {
            type: Boolean,
            required: true,
        },
    },

    data() {
        return {};
    },

    setup(props) {
        function procenat4decimale(a, b) {
            return Number((Math.round(((a * 100) / b) * 10000) / 10000).toFixed(4));
        }
        function nadjiIndeksToplote(vrednost, maxVrednost) {
            return Math.min(Math.trunc((8 * vrednost) / maxVrednost) + 1, 8);
        }
        function nadjiStilToplote(indeksToplote) {
            return 'vector-effect: non-scaling-stroke; fill: #' + mapaToplote[indeksToplote] + '; stroke: rgb(255, 100, 100)';
        }
        function dodajGradUMapuGeografije(mapaGeografije, postojiOpstina, idGrada, imeGrada, maxBrojPotpisa, maxProcenat) {
            mapaGeografije.value[idGrada].nazivOpstine = imeGrada;
            mapaGeografije.value[idGrada].idOpstine = idGrada;
            mapaGeografije.value[idGrada].brojPotpisa = ukupnoPotpisa;
            mapaGeografije.value[idGrada].ukupnoGlasaca = ukupnoGlasaca;
            mapaGeografije.value[idGrada].procenatPotpisalo = procenat4decimale(ukupnoPotpisa, ukupnoGlasaca);
            if (props.procentualnaToplota) {
                mapaGeografije.value[idGrada].stilOpstine = nadjiStilToplote(nadjiIndeksToplote(mapaGeografije.value[idGrada].procenatPotpisalo, maxProcenat));
                mapaGeografije.value[idGrada].vrednostUzIme = mapaGeografije.value[idGrada].procenatPotpisalo + '%';
            } else {
                mapaGeografije.value[idGrada].stilOpstine = nadjiStilToplote(nadjiIndeksToplote(mapaGeografije.value[idGrada].brojPotpisa, maxBrojPotpisa));
                mapaGeografije.value[idGrada].vrednostUzIme = mapaGeografije.value[idGrada].brojPotpisa;
            }
        }
        const mapaToplote = {
            0: 'C0C0C0',
            1: 'fed976',
            2: 'feb24c',
            3: 'fd8d3c',
            4: 'fc4e2a',
            5: 'e31a1c',
            6: 'b10026',
            7: '8d001e',
            8: '6a0016',
        };
        const defaultStilOpstine = 'vector-effect: non-scaling-stroke; fill: rgb(211, 211, 211); stroke: rgb(255, 100, 100)';
        const mapaGeografije = ref({});
        for (let pgindex in props.geografija) {
            let indeksToplote = 0;
            mapaGeografije.value[pgindex] = structuredClone(toRaw(props.geografija[pgindex]));
            if (props.procentualnaToplota) {
                mapaGeografije.value[pgindex].vrednostUzIme = mapaGeografije.value[pgindex].procenatPotpisalo + '%';
                indeksToplote = nadjiIndeksToplote(mapaGeografije.value[pgindex].procenatPotpisalo, props.maxProcenat);
            } else {
                mapaGeografije.value[pgindex].vrednostUzIme = mapaGeografije.value[pgindex].brojPotpisa;
                indeksToplote = nadjiIndeksToplote(mapaGeografije.value[pgindex].brojPotpisa, props.maxBrojPotpisa);
            }
            mapaGeografije.value[pgindex].stilOpstine = nadjiStilToplote(indeksToplote);
        }
        return { mapaGeografije, defaultStilOpstine };
    },

    methods: {},
};
